package com.tabroadn.bookbrowser.service;

import java.sql.Date;
import java.util.Arrays;
import java.util.Base64;
import java.util.List;
import java.util.stream.Collectors;

import org.springframework.context.annotation.Profile;
import org.springframework.stereotype.Component;

import com.tabroadn.bookbrowser.entity.Book;

@Profile("mock")
@Component
public class MockBookService implements BookService {
	private List<Book> books;
		
	public MockBookService() {
		Book book = new Book();
		book.setId(0L);
		book.setTitle("The Deep & Dark Blue");
		book.setDescription("After a terrible political coup usurps their noble house, Hawke and Grayson flee to stay alive and assume new identities, Hanna and Grayce. Desperation and chance lead them to the Communion of Blue, an order of magical women who spin the threads of reality to their will.\tAs the twins learn more about the Communion, and themselves, they begin to hatch a plan to avenge their family and retake their royal home.While Hawke wants to return to his old life, Grayce struggles to keep the threads of her new life from unraveling, and realizes she wants to stay in the one place that will allow her to finally live as a girl. ");
		book.setThumbnail(Base64.getDecoder().decode(""));
		book.setUploadDate(new Date(System.currentTimeMillis()));
		
		books = Arrays.asList(book);
	}

	@Override
	public List<Book> getNewBooks() {
		return books;
	}

	@Override
	public List<Book> getPopularBooks() {
		return books;
	}

	@Override
	public Book findById(Long id) {
		for (Book book : books) {
			if (book.getId() == id) {
				return book;
			}
		}
		return null;
	}

	@Override
	public List<Book> findByTitleContaining(String title) {
		return books.stream().filter((book) -> book.getTitle().toLowerCase().contains(title.toLowerCase())).collect(Collectors.toList());
	}

}
